var fire = require('fire')
function ExamplesHelloWorld() {

}
ExamplesHelloWorld.prototype = new fire.Expression()
ExamplesHelloWorld.prototype.execute = function() {
	var self = this
	this.runInput(function(res) {
		self.end(res)
	});
}
fire.igniteModule(module, require).exportExpression({
	name: "Examples.HelloWorld",
	implementation: ExamplesHelloWorld
})
